import React from 'react';
import '.././style/App.css';
import Sample from '.././feed/sample.json';

var qq = Sample.entries;


class Movies extends React.Component {

  render(){

    return (
      <ul>{

        qq.map((s) => {

          return(
            <div>

              <div class="titre">
                <p>
                  Popular Movies
                </p>
              </div>
              <h1>
                {s.title}
              </h1>
              <img src={s.images.Poster_Art.url} />
            </div>
          );
        })
      }



      </ul>
    )
  }
}

export default Movies;
